import React from 'react';
import NavBar from '../components/navbar.jsx';

const About = () => {
    return (
        <div className='container'>
            <header className="App-header">
                <NavBar/>
            </header>
            <main className='container'>
                <div className='container'>
                    <h4>Version 1.0.0</h4>
                    <a href='/'>Go Back</a>

                </div>
            </main>
        </div>
    )
};
export default About;
